import axios from 'axios'

const authenticate = (next) => {
    let id
    axios.get('http://localhost:3001/api/users/').then((response) => {
        if (response.status === 200) {
            id = response.data
        } else {
            alert(response)
        }
    }).catch(err => {
        alert(err)
    })
    return next(id)
}

export default authenticate
